pragma solidity ^0.8;

/**
 * @dev String operations.
 */
library StringHelper {
    /**
     * `string` contains special characters.
     */
    function strContains(string memory inputCase, bytes memory chars) internal pure returns (bool) {
        bytes memory b_inputCase = bytes(inputCase);
        bool result = false;
        for(uint256 i = 0; i < b_inputCase.length; i++)
        {
            for(uint256 j = 0; j < chars.length; j++)
            {
                //string is contains char
                if(b_inputCase[i] == chars[j]){
                    result = true;
                    break;
                }
            }
            if(result){
                break;
            }
        }
        return result;
    }

    function copyBytes(bytes calldata b_data, uint256 strLength) external pure returns(bytes memory resultData)
    {
        bytes memory result = new bytes(strLength);
        for(uint256 i = 0; i < strLength; i++)
        {
            result[i] =  b_data[i];
        }
        return result;
    }
}

